import { Component, AfterViewChecked, OnInit } from '@angular/core';
import { Subject, takeUntil } from 'rxjs';
import { GlobalFeaturesService } from 'src/app/services/global-features.service';

@Component({
  selector: 'app-right-column',
  templateUrl: './right-column.component.html',
  styleUrls: ['./right-column.component.scss']
})
export class RightColumnComponent implements OnInit, AfterViewChecked {
  private unsubscribe$ = new Subject<void>();
  threeColumnLayout?: boolean;
  cornerStone?: boolean;
  windowWidth?: number;

  socials: { name: string; link: string; altText: string; src: string }[] = [
    {
      name: 'Facebook',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'Facebook logo'
    },
    {
      name: 'LinkedIn',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'LinkedIn logo'
    },
    {
      name: 'Flickr',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'Flickr logo'
    },
    {
      name: 'Pinterest',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'Pinterest logo'
    },
    {
      name: 'TikTok',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'TikTok logo'
    },
    {
      name: 'Instagram',
      link: '',
      src: 'data:image/png;base64,',
      altText: 'Instagram logo'
    }
  ];

  constructor(private _globalFeatures: GlobalFeaturesService) {}

  ngOnInit(): void {
    // this.initializeMapOptions();
  }

  ngAfterViewChecked(): void {
    this._globalFeatures.currentWidth$
      .pipe(takeUntil(this.unsubscribe$))
      .subscribe((val) => {
        this.windowWidth = val;
      });
  }

  navigateToPage(url: string) {
    this._globalFeatures.externalLink(url);
  }

  ngOnDestroy() {
    this.unsubscribe$.next();
    this.unsubscribe$.complete();
  }
}
